import React, { useState } from 'react'
import { useEffect } from 'react';
import CartService from '../services/CartService';

const Cart = ({userId}) => {

const [cartList, setcartList] = useState([]);
useEffect(() => {
    const fetchList = (userId) =>{
        CartService.getCartByUserId(userId)
        .then((response) =>{
            console.log(response);
            setcartList(response.data);
        }).catch((error) =>{
            console.log(error);
        })
    }
    fetchList(userId);
    console.log(cartList);
}, [])


  return (
    <div className='table'>
        <table id='productCartBody'>
            <thead>
                <tr >
                <th className='firstItem'>Product Name</th>
                <th>Price</th>
                <th>Quantity</th>
                </tr>
            </thead>
            <tbody>
                <tr id='product1'>
                    <td className='firstItem'><span className='indexNo'>1. </span>Carrom Board</td>
                    <td>$120</td>
                    <td>3 ps</td>
                </tr>
                <tr>
                    <td className='firstItem'><span className='indexNo'>2. </span>Tennis bat</td>
                    <td>$10</td>
                    <td>10 ps</td>
                </tr>
                <tr>
                    <td className='firstItem'><span className='indexNo'>3. </span>Cricket bat</td>
                    <td>$30</td>
                    <td>6 ps</td>
                </tr>
            </tbody>

        </table>
        <div className='orderBtnDiv'>
            <button className='orderBtn' id='placeOrderButton'>Place Order</button>
        </div>
    </div>
  )
}

export default Cart
